// src/App.js
import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import { Container, CssBaseline, ThemeProvider, createTheme, Box } from '@mui/material';
import Login from './components/Login';
import BusinessDetailsView from './components/BusinessDetailsView/BusinessDetailsView';
import StageManager from './components/StageManager';
import StageEditor from './components/StageEditor';
import Snackbar from '@mui/material/Snackbar';
import Alert from '@mui/material/Alert';
import ApiTester from './components/ApiTester';
import Header from './components/Header';
import Footer from './components/Footer';
import Home from './components/Home';

const theme = createTheme({
  palette: {
    mode: 'light',
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
});

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [userId, setUserId] = useState('');
  const [businessId, setBusinessId] = useState('');
  const [businessApiKey, setBusinessApiKey] = useState('');
  const [snackbar, setSnackbar] = useState({ open: false, message: '', severity: 'success' });

  // --- Add Logging to Setters --- 
  const updateUserId = (value) => {
    console.log("App.js: Updating userId to:", value);
    setUserId(value);
  };
  const updateBusinessId = (value) => {
    console.log("App.js: Updating businessId to:", value);
    setBusinessId(value);
  };
  const updateBusinessApiKey = (value) => {
    console.log("App.js: Updating businessApiKey to:", value);
    setBusinessApiKey(value);
  };
  const updateIsAuthenticated = (value) => {
    console.log("App.js: Updating isAuthenticated to:", value);
    setIsAuthenticated(value);
  };
  // -----------------------------

  useEffect(() => {
    // Check for stored credentials on component mount
    const storedUserId = localStorage.getItem('userId');
    const storedBusinessId = localStorage.getItem('businessId');
    const storedBusinessApiKey = localStorage.getItem('businessApiKey');

    if (storedUserId && storedBusinessId && storedBusinessApiKey) {
      setUserId(storedUserId);
      setBusinessId(storedBusinessId);
      setBusinessApiKey(storedBusinessApiKey);
      setIsAuthenticated(true);
    }
  }, []);

  const handleSnackbarOpen = (message, severity = 'success') => {
    setSnackbar({ open: true, message, severity });
  };

  const handleSnackbarClose = () => {
    setSnackbar({ ...snackbar, open: false });
  };

  const handleLogout = () => {
    // Clear stored credentials
    localStorage.removeItem('userId');
    localStorage.removeItem('businessId');
    localStorage.removeItem('businessApiKey');

    // Reset state
    setUserId('');
    setBusinessId('');
    setBusinessApiKey('');
    setIsAuthenticated(false);

    // Show success message
    handleSnackbarOpen('Logged out successfully', 'success');
  };

  return (
    <Router>
      <ThemeProvider theme={theme}>
        <CssBaseline />
        <Box sx={{ display: 'flex', flexDirection: 'column', minHeight: '100vh' }}>
          <Header />
          <Container component="main" sx={{ flexGrow: 1, py: 3 }}>
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/stages" element={<StageManager />} />
              <Route path="/stages/:stageId" element={<StageEditor />} />
              <Route path="/api-tester" element={<ApiTester />} />
              <Route 
                path="/login" 
                element={
                  isAuthenticated ? (
                    <Navigate to="/business" replace />
                  ) : (
                    <Login 
                      userId={userId}
                      setUserId={updateUserId}
                      businessId={businessId}
                      setBusinessId={updateBusinessId}
                      businessApiKey={businessApiKey}
                      setBusinessApiKey={updateBusinessApiKey}
                      setIsAuthenticated={updateIsAuthenticated}
                      handleSnackbarOpen={handleSnackbarOpen}
                    />
                  )
                } 
              />
              <Route 
                path="/business" 
                element={
                  isAuthenticated ? (
                    <BusinessDetailsView />
                  ) : (
                    <Navigate to="/login" replace />
                  )
                } 
              />
              <Route 
                path="/stage-management" 
                element={
                  isAuthenticated ? (
                    <StageManager />
                  ) : (
                    <Navigate to="/login" replace />
                  )
                } 
              />
              <Route 
                path="/stage-management/business_id=:businessId" 
                element={
                  isAuthenticated ? (
                    <StageManager />
                  ) : (
                    <Navigate to="/login" replace />
                  )
                } 
              />
              <Route 
                path="/stage-management/business_id=:businessId/agent_id=:agentId" 
                element={
                  isAuthenticated ? (
                    <StageManager />
                  ) : (
                    <Navigate to="/login" replace />
                  )
                } 
              />
              <Route 
                path="/stage-editor/:stageId" 
                element={
                  isAuthenticated ? (
                    <StageEditor />
                  ) : (
                    <Navigate to="/login" replace />
                  )
                } 
              />
              <Route 
                path="/stage-editor/new" 
                element={
                  isAuthenticated ? (
                    <StageEditor />
                  ) : (
                    <Navigate to="/login" replace />
                  )
                } 
              />
            </Routes>
          </Container>
          <Footer />
        </Box>
      </ThemeProvider>
      <Snackbar 
        open={snackbar.open} 
        autoHideDuration={6000} 
        onClose={handleSnackbarClose}
        anchorOrigin={{ vertical: 'top', horizontal: 'center' }}
      >
        <Alert onClose={handleSnackbarClose} severity={snackbar.severity} sx={{ width: '100%' }}>
          {snackbar.message}
        </Alert>
      </Snackbar>
    </Router>
  );
}

export default App;
